import React from 'react'
import {Menu} from 'semantic-ui-react'

const Navbar = () => {
    return(
        <>
            <Menu
            size={"large"}
            >
                <Menu.Item>Home</Menu.Item>
                <Menu.Item>About</Menu.Item>
            </Menu>
        </>
    )
}

export default Navbar
